import React from 'react';

const Booking = () => {
    return(
        <form action="#" method="post">
            <label>Ditt namn:
                <input type="text" />
            </label>

            <label>Tid:
                <input type="datetime-local" />
            </label>

            <input type="submit" name="book" value="boka" />
        </form>
    )
}

export default Booking;
